import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
	const navigate = useNavigate();
	if (localStorage.getItem('email')) {
		return <div>{localStorage.getItem('email')}</div>;
	} else {
		return <div>ログインしてください</div>;
	}
}

export default Home;
